import logo from './pluginIcon.png';
import './App.css';
import raw from './input.txt';

function getContent() {
  //var inputContent = "hello";

  fetch(raw)
  .then(r => r.text())
  .then(data => {
    const inputContent = data.split(/\r?\n/);
    console.log('text decoded:', data);
    return inputContent;
  });
}

function App() {

   return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          <code>adventofcode.com/2023</code> 
        </p>
        <a
          className="App-link"
          href="https://adventofcode.com/2023/day/1"
          target="_blank"
          rel="noopener noreferrer"
        >
          Day 1: Trebuchet?!
        </a>
      </header>
      <body className="App-body">
        List of strings {getContent()}
      </body>
    </div>
  );
}

export default App;
